■商品説明<br>
サイズ：全長約145mm程度　ナスカン約31×10mm<br>
※こちらの商品は手作りの為、チェーンの長さに±10mm程度の誤差がございます。予めご了承の上でのご購入をお願い申し上げます。<br>
数量：1本
<br>
■スタッフより一言♪<br>
おしゃれなバッグ用チェーンです。<br>ナスカン付だから簡単に取り外しができるのが嬉しいポイント♪<br>バッグやポーチのハンドメイドやリメイクにおすすめです。<br><br>
<br>
<font color="ff0000">※画像4枚目の様に、メッキにムラやサビなどがございます。予め、ご理解のうえご購入ください。</font><br>
※海外製品ですので多少のキズ、汚れ、メッキの色ムラ等あらかじめご了承ください。<br>
<br>
※注意※<br>
商品について<br>
※入荷時（パッキング済み）の商品をそのまま発送いたします。下記内容をご理解・ご了承いただいた上でご注文ください。<br>
　◆商品詰め工程において埃や小さなごみが混じることがあります。<br>
　◆手作り、海外生産の為、多少の柄ずれ、キズ、汚れがある場合がございます。<br> 
　◆小さな商品には欠けたものや変形したものが混じっている場合があります。<br>
※他サイトとの在庫を共有しているため、更新のタイミングによってはページ上の在庫と実在庫に相違が出る場合がございます。予めご了承ください<br>
※入荷時期により予告無く内容カラーの変更がございます。<style type="text/css">
